    "2015-11-10T01:32:43.757493",nt"name": "bathymetric-position-index-bpi-structures-60-m-grid-derived-from-gridded-bathymetry-of-rota-isl",nt"isopen":
    false,nt"url": null,nt"notes": "BPI Structures are derived from two scales
    of a focal mean analysis on bathymetry and slope. The grid is based on gridded (60
    m cell size) multibeam bathymetry, collected aboard NOAA Ship Hi'ialakai and R/V
    AHI, and it was created using the Benthic Terrain Modeler (http://www.csc.noaa.gov/products/btm/).
    Cell values represent one of 14 classes in an index of seafloor terrains. This data
    set is for the shelf and slope environments of Rota Island. As part of the southern
    islands in the Mariana Islands archipelago, Rota has a shelf (above -100m) with
    escarpments that lead to broad flat areas without forming a deeper shelf. Conversely,
    the northern islands each have a shelf (above -60m), and most have a deep shelf
    (below -60m), with escarpments that lead outside of the coverage area.",nt"license_title":
